INSERT INTO `category_description` (`category_id`, `name`, `description`) VALUES
(220,	'Сантехника',	'&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif;&quot;&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif;&quot;&gt;Интернет-магазин «ЮнитДом» предлагает купить сантехнику и комплектующие онлайн с доставкой в СПб и других регионах России. Вас порадует уровень цен и сервиса, поскольку продажа сантехники – основное направление нашей деятельности.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif;&quot;&gt;К вашим услугам:&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li style=&quot;text-align: justify;&quot;&gt;&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif;&quot;&gt;оперативная обратная связь;&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;\r\n	&lt;li style=&quot;text-align: justify;&quot;&gt;&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif;&quot;&gt;полезные советы консультантов;&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;\r\n	&lt;li style=&quot;text-align: justify;&quot;&gt;&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif;&quot;&gt;удобные каталоги с возможными интерьерными решениями;&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;\r\n	&lt;li style=&quot;text-align: justify;&quot;&gt;&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif;&quot;&gt;&lt;span style=&quot;line-height:107%&quot;&gt;профессиональный монтаж.&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif;&quot;&gt;&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif;&quot;&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;\r\n&lt;/ul&gt;\r\n'),
(222,	'Системы отопления',	'&lt;p&gt;&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif;&quot;&gt;Для того чтобы в холодный зимний период обеспечить в жилом помещении необходимые условия для проживания, нужна система, которая помогала бы поддерживать нужный температурный режим. Система отопления является наиболее удачным инженерным решением данной проблемы.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n'),
(223,	'Освещение',	'&lt;p&gt;&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif;&quot;&gt;ЮнитДом - это удобный сервис, с помощью которого легко выбрать светильник, проверить, как он подходит к вашему интерьеру. С помощью большого каталога товаров каждый сможет выбрать и купить себе для любого помещения. Забрать товар можно самовывозом в или заказать курьерскую доставку на дом.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n'),
(224,	'Мебель для ванной',	'&lt;p&gt;&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif;&quot;&gt;Мебель для ванной должна быть компактной, так как это зачастую самое маленькое помещение в квартире. Она должна быть устойчивой к химическим и физическим воздействиям и не нарушать общий облик комнаты. Продукция европейских и отечественных производителей на нашем сайте имеет сертификат качества, соответствующий всем международным стандартам. Помимо этого, все товары идут с обязательной гарантией. При выборе какого-либо предмета мебели для санузла, можно сэкономить на стоимости, но не на качестве.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n'),
(225,	'Ванны',	'&lt;p style=&quot;text-align: justify; &quot;&gt;&lt;span style=&quot;font-family: Arial;&quot;&gt; &lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif;&quot;&gt;Интернет-магазин «ЮнитДом» предлагает купить ванну с функциональными аксессуарами, гидромассажем: в СПб покупателям представлен широчайший ассортимент сантехники, изготовленной из традиционных чугуна и стали, недорогого акрила и литьевого мрамора. &lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif;&quot;&gt;«ЮнитДом» реализует качественную продукцию отечественных и зарубежных производителей из Германии, Италии, Швеции, Польши, Китая.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;text-align: justify; &quot;&gt;&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif;&quot;&gt;&lt;span style=&quot;line-height:107%&quot;&gt;Приобрести ванны вам поможет каталог: выбирайте нужные позиции, смотрите фотографии, цены, описания. Все предложенные модели отличаются качеством изготовления, продолжительным сроком службы, практичностью в уходе.&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-family: Arial;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n'),
(226,	'Душевые',	'&lt;p&gt;Душевые куку&lt;/p&gt;\r\n'),
(227,	'Санфаянс',	'&lt;p&gt;&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif;&quot;&gt;Начиная ремонт рекомендуем зайти в интернет магазин ЮнитДом в СПб, здесь купить санфаянс: унитазы, раковины и биде можно легко и быстро. У нас широкий ассортимент и низкая цена – санфаянс: унитазы, раковины и биде от 1100 руб.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n'),
(229,	'Смесители',	'&lt;p&gt;&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif;&quot;&gt;С годами любой смеситель советского производства окончательно выходит из строя – он «поет» или вода начинает течь тонкой струйкой. Вместо того, чтобы подвергать его ремонту или покупать аналогичный б/у, лучше купить смеситель новый, встречающийся на рынке сантехники абсолютно разных конфигураций. В нашем каталоге представлен широкий ассортимент смесителе:&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n'),
(239,	'Котельное оборудование',	'&lt;p&gt;&lt;br&gt;&lt;/p&gt;'),
(250,	'Тумба умывальник до 70 см',	'&lt;p&gt;&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif;&quot;&gt;Начиная ремонт в своей ванной комнате, мы рекомендуем обратиться в наш магазин ЮнитДом, здесь можно купить тумбы с умывальником от 50 до 70 см быстро и выгодно. Каждому покупателю гарантирована низкая цена – тумбы с умывальником от 50 до 70 см от 2 600р&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n'),
(251,	'от 110 см',	'&lt;p&gt;&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif;&quot;&gt;Начиная ремонт в своей ванной комнате, мы рекомендуем обратиться в наш магазин ЮнитДом, здесь можно купить тумбы с раковиной от 110 см быстро и выгодно. Каждому покупателю гарантирована низкая цена – тумбы с раковиной от 110 см от 9 310р&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n'),
(252,	'Аксессуары',	'&lt;p&gt;&lt;br&gt;&lt;/p&gt;'),
(253,	'Тумба умывальник до 50 см',	'&lt;p&gt;&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif;&quot;&gt;Начиная ремонт в своей ванной комнате, мы рекомендуем обратиться в наш магазин ЮнитДом, здесь можно купить тумбы с умывальником от 30 до 50 см быстро и выгодно. Каждому покупателю гарантирована низкая цена – тумбы с умывальником от 30 до 50 см от 2 980р&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n'),
(254,	'71-90 см',	'&lt;p&gt;&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif;&quot;&gt;Начиная ремонт в своей ванной комнате, мы рекомендуем обратиться в наш магазин ЮнитДом, здесь можно купить тумбы с раковиной от 70 до 90 см быстро и выгодно. &lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif;&quot;&gt;Каждому покупателю гарантирована низкая цена – тумбы с раковиной от 70 до 90 см от 2 600р&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n'),
(255,	'91-110 см',	'&lt;p&gt;&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif;&quot;&gt;Начиная ремонт в своей ванной комнате, мы рекомендуем обратиться в наш магазин ЮнитДом, здесь можно купить тумбы с раковиной от 90 до 110 см быстро и выгодно. Каждому покупателю гарантирована низкая цена – тумбы с раковиной от 90 до 110 см от 7 750р&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n'),
(257,	'Акриловые ванны',	'&lt;p&gt;&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif;&quot;&gt;Интернет-магазин «ЮнитДом» предлагает купить акриловые ванны в СПб по самым доступным ценам. У нас – большой выбор прямых, угловых, отдельностоящих и пристанных моделей, специально подобран ассортимент комплектующих и аксессуаров от известных российских и зарубежных производителей.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n'),
(258,	'Гидромассажные ванны',	'&lt;p style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif;&quot;&gt;&lt;span style=&quot;line-height:107%&quot;&gt;Гидромассажные ванны на рынке появились сравнительно недавно и за небольшой промежуток времени стали набирать популярность среди покупателей. Помимо того, такие установки составили немалую конкуренцию для аналогичных моделей. Ведь гидромассажные ванны оснащены рядом полезных и очень удобных функций: ручки, подголовники, непосредственно гидромассаж и пр. &lt;/span&gt;&lt;span style=&quot;line-height:107%&quot;&gt;На сайте нашего интернет-магазина в СПб, вы легко сможете выбрать и купить гидромассажную ванну, так как их ассортимент очень широк и разнообразен. У нас представлена продукция как от отечественных, так и от зарубежных производителей.&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n'),
(259,	'Чугунные ванны',	'&lt;p style=&quot;text-align: justify; &quot;&gt;&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif;&quot;&gt;&lt;a href=&quot;https://unitdom.ru/&quot;&gt;Интернет-магазин сантехники&lt;/a&gt; «ЮнитДом» предлагает купить чугунную ванну в СПб. Это традиционный, но вполне оправданный выбор при обустройстве ванной комнаты. Вас приятно удивят цены на качественную продукцию от известных российских и зарубежных производителей.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n'),
(260,	'Стальные ванны',	'&lt;p&gt;&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif;&quot;&gt;Стальная ванна – практичное и недорогое решение при оформлении ванной комнаты. В Санкт-Петербурге &lt;a href=&quot;https://unitdom.ru/&quot;&gt;интернет-магазин сантехники&lt;/a&gt; «ЮнитДом» предлагает широкий ассортимент изделий отечественных и зарубежных производителей: вы сможете недорого приобрести &lt;a href=&quot;https://unitdom.ru/vanny/&quot;&gt;ванны&lt;/a&gt; из стали, купить необходимые аксессуары и комплектующие.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n'),
(261,	'Шторки на ванну',	'&lt;p&gt;&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif;&quot;&gt;Душевая перегородка или шторка для ванной, предложенные в интернет-магазине «ЮнитДом» в СПб, — необходимый аксессуар. Шторки в ванную комнату, выполненные из специального закаленного стекла, защитят от влаги поверхности стен и пола во время приема водных процедур, помогут эргономично и эстетично организовать пространство, фото, цена, характеристики - по каждому изделию в каталоге.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n'),
(263,	'Душевые кабины',	'&lt;p&gt;&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif;&quot;&gt;Для экономии пространства в ванной комнате хозяева всё чаще отказываются от установки традиционных ванн, предпочитая именно душевые кабины. &lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif;&quot;&gt;Сейчас на рынке предлагается огромное разнообразие товаров по размеру, цвету, форме и цене. Вы запросто можете приобрести тот товар, который идеально впишется в ваш дизайн. Можно купить душевую кабину в СПб быстро и при этом сэкономить деньги, так как сегодня рынок делает возможным соединить воедино цену и качество. &lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif;&quot;&gt;Заказать ее в Санкт-Петербурге не будет проблемой, поскольку доступно целое множество продукции европейских и отечественных производителей. На всю продукцию дается гарантия. Также предлагаются услуги по установке. Гараетированны низкие цены по СПб. В каталоге интернет-магазина ЮнитДом более 2000 моделей по цене от 11 500 рублей.&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://unitdom.ru/image/catalog/1-AMPM/BACHKI/kabina-garantia-1.jpg&quot; style=&quot;width: 850px; height: 160px;&quot; /&gt;&lt;/p&gt;\r\n'),
(264,	'Душевые уголки',	'&lt;p&gt;&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif;&quot;&gt;Душевые уголки пришли на смену чугунным ваннам, они позволяют сэкономить пространство комнаты и освободить его, например, под стиральную машинку, корзину  для белья, прочие семейные нужды. Если важен каждый метр, то выбирайте душевые уголки европейских и отечественных производителей. Они прочны и надежны. &lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif;&quot;&gt;Время диктует определенные правила и требования, предъявляемые к пространству комнат. В основном все потребители хотят отменное качество и вместимость. Поэтому есть оптимальный вариант для ванных комнат, которые не отличаются особенно  большой площадью. Купить душевой уголок&lt;strong&gt; &lt;/strong&gt;можно&lt;strong&gt; &lt;/strong&gt;в нашем интернет-магазине. &lt;/span&gt;&lt;/span&gt;Можно выбрать любые модели, кроме того, само оформление может быть прозрачным или тонированным, цветным. Современный рынок позволит удовлетворить любой изыск. Материал душевых уголков неприхотлив, поэтому и ухаживать за ними легко. Их достаточно протереть влажной губкой. &lt;em style=&quot;color: rgb(255, 0, 0);&quot;&gt;Практичность, качество, удобство!&lt;/em&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n'),
(265,	'Душевые панели',	'&lt;p&gt;&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif;&quot;&gt;Душевая панель, купить которую можно в интернет-магазине “ЮнитДом”, представляет из себя конструкцию с вмонтированными форсунками, переключателями режимов, душевыми лейками и прочими приспособлениями. &lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n'),
(266,	'Двери в нишу',	'&lt;p&gt;&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif;&quot;&gt;Выбирая недорогую сантехнику рекомендуем зайти в интернет магазин ЮнитДом в СПб, тут купить душевые двери можно без лишних усилий. У нас большой выбор и доступная цена - душевые двери в нишу от 6000 руб.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n'),
(271,	'Полотенцесушители',	'&lt;p&gt;&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif;&quot;&gt;Наш интернет-магазин полотенцесушителей в Санкт-Петербурге предлагает большой выбор моделей от разных производителей, все они высокого качества. Каждый клиент может рассчитывать на консультационную помощь наших специалистов.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n'),
(273,	'Унитазы',	'&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif;&quot;&gt;Купить унитаз не составит большого труда: выбрать модель, которая идеально впишется в любую ванную комнату или туалет проще простого. Покупатель даже может выбрать практически любой цвет (от чёрного до разноцветного), а не только классику – белый. При выборе любого товара, следует учитывать его качество. Вот, к примеру, в Европе очень ценятся финские модели. Купить унитаз в Санкт-Петербурге стало теперь ещё проще – ассортимент интернет-магазина сантехники ЮнитДом может удовлетворить практически любой запрос. На нашем сайте представлены детские и взрослые, напольные и подвесные унитазы, а также угловые и эксклюзивные. Сантехника изготавливается по европейским технологиям и прослужит вам безупречно многие годы.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n'),
(274,	'Биде',	'&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif;&quot;&gt;Как только не называют биде: небольшая ванночка,раковина и т.д. В любом случае этот элемент интерьера ванной или туалетной комнаты прочно закрепил свои позиции на рынке сантехнической продукции.Именно поэтому как знаменитые, так и малоизвестные бренды (AM.PM, AXA, Duravit, Jacob Delafon и т.д.) производят биде, выпуская товары высокого качества. &lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif;&quot;&gt;По способу установки биде делятся на &lt;a href=&quot;https://unitdom.ru/napolnye-bide/&quot;&gt;напольные&lt;/a&gt; и подвесные. Если же говорить о дизайне,то тут уж всё зависит от предпочтений конкретного покупателя. Специалисты компаний, производящих сантехническую продукцию, а также дизайнеры, используют инновационные технологии и реализуют самые замысловатые проекты моделей,поэтому можно приобрести биде разнообразных оттенков, стилей и форм. Причем все они представлены в нашем интернет-магазине сантехники ЮнитДом.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n'),
(275,	'Пиcсуары',	'&lt;p&gt; &lt;img align=&quot;left&quot; alt=&quot;&quot; height=&quot;164&quot; src=&quot;/image/data/santehnika/duravit/pissuar/083432.jpg&quot; width=&quot;126&quot;&gt;Как правило, &lt;strong&gt;писсуары&lt;/strong&gt; можно встретить в общественных местах: кинотеатрах, ресторанах и кафе, ночных клубах и т.д. Тем не менее, в последнее время отмечается тенденция их установки в частных домах и квартирах, где ванные или туалетные комнаты имеют большую площадь. В данном случае многое зависит от личных предпочтений покупателя, так как все-таки писсуар нельзя назвать стопроцентным аналогом унитаза.&lt;/p&gt; &lt;p&gt;\r\n	Если говорить о брендах, которые производят &lt;strong&gt;писсуары&lt;/strong&gt;, стоит отметить AMPM, OXO, Jacob Delafon, Duravit, Laufen, AZZURRA и т.д. Каждая компания придерживается собственного стилевого оформления, поэтому модели отличаются между собой не только оттенками, но и формами. Например, некоторые писсуары идут в комплекте с крышкой, а при изготовлении других использовалась нержавеющая сталь.&lt;/p&gt; &lt;p&gt; &lt;em&gt;И все это разнообразие моделей готов предложить интернет-магазин ЮнитДом.&lt;br&gt; &lt;/em&gt;&lt;/p&gt;\r\n'),
(276,	'Раковины',	'&lt;br&gt;'),
(277,	'Инсталляции',	'&lt;p&gt;&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif;&quot;&gt;Если вы хотите купить подвесные унитазы или биде, тогда вам потребуется инсталляция, которая представляет собой специальную металлическую конструкцию, необходимую для установки такой системы. Как показывает аналитика продаж, стоимость на инсталляцию примерно такая же, как на само сантехническое устройство, например, минимальная цена такой комплектующей детали для раковины – 4 200 рублей. Зато такие конструкции вы сможете использовать и в будущем, даже когда захотите сменить основное сантехническое приспособление.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n'),
(278,	'Смесители для раковины',	'&lt;p&gt;&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif;&quot;&gt;Чтобы выбрать, а затем и купить смеситель для раковины правильно, нужно четко представлять, в каком помещении он будет располагаться. Чаще всего без смесителя не обойтись на кухне, в ванной комнате и в туалете при наличии биде. Так как изделия для ванной пользуются особым спросом, то и выбор этих моделей гораздо шире. Особенность таких приборов заключается в низком уровне пролива. Существуют модели с поворотным механизмом приведения в действие и с фиксированным. В нашем каталоге представлен большой ассортимент смесителей:&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n'),
(279,	'Смесители для кухни',	'&lt;p&gt;&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif;&quot;&gt;Предлагаем купить смесители для кухни в нашем интернет-магазине. Это замечательное приспособление значительно облегчает процесс приготовления пищи и уход за помещением. Хозяйка может управлять клапаном, даже если у нее заняты руки.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n'),
(280,	'Смесители для ванны с душем',	'&lt;p&gt;&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif;&quot;&gt;Устарело и испортилось сантехническое оборудование? Значит, пришло время купить смеситель для ванны с душем в современном исполнении. Огромный выбор подобных товаров в нашем магазине рассчитан на вкусы и возможности людей разного достатка.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n'),
(281,	'Смесители для биде',	'&lt;p&gt;&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif;&quot;&gt;С каждым годом все большую популярность у покупателей приобретают приспособления для соблюдения интимной гигиены. Чтобы чаша служила эффективно, нужно купить надежный и удобный смеситель для биде с дополнительными насадками и функциями.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n'),
(283,	'Термостатические смесители',	'&lt;p&gt;&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif;&quot;&gt;Наконец-то научно-технические разработки добрались до наших санузлов! Предлагаем купить новейшие модели термостатических смесителей в нашем интернет-магазине. В каталоге представлены образцы, полностью исключающие резкие перепады температуры воды.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n'),
