(1593,	'Кухонные комбайны',	'&lt;p&gt;&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif;&quot;&gt;Кухонный комбайн - уникальное оборудование, изобретение которого стало поворотным событием в ведении домашнего хозяйства и в быту женщин. Компактные, удобные в эксплуатации приборы совместили функции множества предметов бытовой техники - мясорубки, терки, блендера, овощерезки, миксера. В каталоге интернет-магазина Юнитдом более 50 моделей по цене от 14000 рублей.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n'),
