(1600,	'Классические вытяжки',	'&lt;p&gt;&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif;&quot;&gt;Классические вытяжки – достойный элемент Вашей кухни! Сегодня потребителям доступен широкий модельный ряд кухонных вытяжных систем, выполненных в различной стилистике, и не запутаться во всём обилии предложений - достаточно сложно. В каталоге интернет-магазина Юнитдом более 50 моделей по цене от 14600 рублей.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n'),
(1602,	'Подогреватели посуды',	'&lt;p&gt;&lt;span style=&quot;font-size:12px;&quot;&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif;&quot;&gt;Современные &lt;b&gt;подогреватели&lt;/b&gt; &lt;b&gt;посуды&lt;/b&gt; идеально комбинируются с духовыми шкафами, пароварками и кофемашинами. Почти каждый аппарат позволяет настроить время и температуру нагрева, сохранив настройки в качестве избранной функции. &lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n'),
